 Open Registration 2022 Terms and Conditions

1 .This Mid-Autumn Spend and Get Promotion 2022 ("Promotion") is valid from 17 June 2022 to 31 July 2022, both dates inclusive ("Promotional Period") unless otherwise stated, and is offered by  Bank (Singapore) Limited ("" or the "Bank") to customers:
a.who hold one or more main  credit cards (except  corporate cards, and  debit cards) issued by  in Singapore (each, a "Card") as a credit cardholder; and
b.whose Card account is in good standing with  over the entire Promotional Period and at the time of fulfillment (as determined by  at its discretion), (each such customer, a "Cardholder")

2 . reserves the right to determine at our discretion whether:z
a.Cardholder(s) have met all the requirements of this Promotion; and
b.Charges made to the Card qualify towards fulfilment of the relevant accumulated minimum Qualifying Spend (as defined below) set for the purposes of this Promotion.

3 .For the purpose of this Promotion:
"Qualifying Spend" shall mean posted retail transactions (including but not limited to monthly charges under the interest free instalment payment plan of any merchant, and in the case of  Spend Instalment, only the total purchase amount will qualify as a Qualifying Spend in the month of purchase), including Local Retail Transactions, Online Transactions and Overseas Transactions, charged to a Registered Card (as defined below) account and/or to the account of the supplemental cardholder of the relevant Registered Cardholder (as defined below) during the Promotional Period BUT shall exclude the Excluded Transactions.

"Local Retail Transactions" shall mean posted retail transactions (excluding Online Transactions) which are successfully carried out in Singapore dollars to a Registered Card account and/or to the account of the supplementary cardholder of the relevant Registered Cardholder.

"Online Transactions" shall mean all retail transactions successfully charged to a Registered Card account and/or to the account of a supplemental cardholder of a Registered Cardholder made via the internet and processed by the respective merchants/acquirers as an online transaction type through the MasterCard International Incorporated and/or Visa Worldwide networks during the Promotional Period.

"Overseas Transactions" shall mean all overseas transactions successfully carried out outside Singapore and charged in foreign currency to a Registered Card account and/or to the account of a supplemental cardholder of a Registered Cardholder during the Promotional Period.

"Excluded Transactions" shall mean any of the following (which shall, where applicable, be determined based on the transaction descriptions reflected in 's system and the merchant category codes from Visa / MasterCard):
	 •Foreign exchange transactions (including but not limited to Forex.com);
	 •Donations and payments to charitable, social organisations and religious organisations;
	 •Quasi-cash transactions (including but not limited to transactions relating to money orders, traveler's checks, gaming related transactions, lottery tickets and gambling);
	 •Payments made to financial institutions, securities brokerages or dealers (including but not limited to the trading of securities, investments or crypto-currencies of any kind);
	 •Payments on money payments/transfers (including but not limited to Paypal, SKR skrill.com, CardUp, SmoovPay, iPayMy);
	 •Payments to any professional services provider (including but not limited to GOOGLE Ads, Facebook Ads, Amazon Web Services, MEDIA TRAFFIC AGENCY INC);
	 •Top-ups, money transfers or purchase of credits of prepaid cards, stored-value cards or e-wallets (including but not limited to Grab Top-Up, EZ-Link, Transitlink, NETS Flashpay and Youtrip);
	 •Payments in connection with any government institutions and/or services (including but not limited to cort costs, fines

